Estamos em migração para o Java , e no módulo Cotação de compra, quando seleciono um fornecedor na aba Cotação - Fornecedor e após vou para aba Documentação/Anexo, ao voltar para a aba cotação fornecedor ele retorna ao primeiro fornecedor selecionado.
