r pela primeira vez o filtro de escolha de data do pagamento escritural o sistema sugere o filtro de 30 dias anteriores à data atual. Sem fechar a tela, quando fazemos o mesmo processo para outro título, o sistema não salva este filtro, fazendo com que tenhamos que selecionar novamente a data, atrasando nosso processo de pagamentos. Obs: o Tasy Delphi realizava o processo, conforme vídeo em anexo.',null,null,null,null,null,'1','1','11','1',null,null,null,null,null,'97',null,null,null,'851',null,'D',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('21/05/19','DD/MM/RR'),'MARCELOSILVA','S',null,null,null,null,null,to_date('21/05/19','DD/MM/RR'),'(16) 3711-4190 | marcelo.melo@santacasadefranca.com.br',null,null,null,null,'1899955',null,null,null,null,'S',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,'4',null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,null,null,'N',null,null,null,null,null,to_date('18/06/19','DD/MM/RR'),null,null,null,null,null,null,null,null,null,'P',null,null,null,null,null,null,'stal-7498',null,null,null,null,null,null,null,null,null,null,null,null,'Cliente (Teste)',null,null,null,'143','N',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null);
