ampo ‘profissional’ e não no campo ‘médico’(PRINT). Lançamentos este que em nosso entendimento é realizado de forma automática.
Ocorre que em razão dos lançamentos serem realizados no campo profissional, gera um impacto no processo de honorários médicos a serem pagos.
Verificamos possíveis diferenças no cadastro dos profissionais na função ‘SUS-BPA’, e também nas  funções: ‘Cadastro Médico’ e ‘Conta Paciente’(PRINT); e fazendo um comparativo com outros casos onde o processo ocorre de forma correta, não encontramos nenhum diferencial no cadastro que possa a vir a impactar.
Gostaríamos de auxílio para entender como o sistema Tasy gera estes lançamentos automaticamente  para que possamos contornar o problema. 
Detalhe: 
Os profissionais que não são tratados como médicos na verdade tem como função/CBO dentista.
Ex :
Atendimento: 7500475
Profissional: Nelson Uzun.',null,to_date('10/05/19','DD/MM/RR'),to_date('13/05/19','DD/MM/RR'),null,null,'1','1','11','1',null,null,null,null,null,'97',null,null,null,'1125',null,'S',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('09/05/19','DD/MM/RR'),'PPCC','S',null,null,null,null,null,to_date('15/05/19','DD/MM/RR'),'ramal: 4191',null,null,null,null,'1893102',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'4',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('04/06/19','DD/MM/RR'),null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'STAL-5555',null,null,null,null,null,null,null,null,null,null,null,null,'Cliente (Teste)',null,null,to_date('10/05/19','DD/MM/RR'),'144',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null);
