mpra que são programadas com o forncedor para serem entregues a longo prazo. Desta forma, uma OC pode ter quantidade correspondente a ser entregue durante 6 meses, por exemplo.
Desta forma, é comum que as NF''s entrem com valores a menor do que o pendente de entrega da OC.
No entanto, o sistema está consistindo estas entradas (conforme prints).
Atualmente, nosso sistema consiste tanto os valores/quantidades a maior, quanto a menor. Porém, desejamos que seja consistido apenas quando for maior. Como fazer?',null,to_date('10/04/19','DD/MM/RR'),to_date('12/04/19','DD/MM/RR'),null,null,'1','1','11','1',null,null,null,null,null,'97',null,null,null,'40',null,'D',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('10/04/19','DD/MM/RR'),'MARCELOSILVA','S',null,null,null,null,null,to_date('15/04/19','DD/MM/RR'),'(16) 3711-4190 | marcelo.melo@santacasadefranca.com.br',null,null,null,null,'1875175',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'4',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('07/05/19','DD/MM/RR'),null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'STAL-7498',null,null,null,null,null,null,null,null,null,null,null,null,'Aguardando InformaÃ§Ãµes do Cliente',null,null,null,'150',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null);
