Estamos utilizando o Tasy Java, porém na função Cotação de Compra, quando há um fornecedor vencedor e eu o exluo da aba ''Cotação Fornecedor''. O item vencedor ele desaparece da GRID pela sequencia, só é identificado no relatório ou via banco de dados.
Em anexo segue o video explicativo. 
No video é utilizado como exemplo o item 51, e ao excluir o fornecedor da cotação  é excluido o item por completo, sendo que deveria seguir para o segundo fornecedor vencedor. Assim como já é realizado no Delphi.

