Conforme discutido na reunião do Nucleo de Segurança do paciente dia 28/03/19 e discutido em algumas reuniões de alinhamento da prescrição eletronica, solicito a inclusão da Dieta Parenteral no campo de dieta na prescrição eletronica.
Atualmente o médico tem acesso para prescrição desta parenteral no campo "medicamentos", sendo o correto no campo "dieta".
Desta mesma forma, ao incluir a dieta parenteral, solicito que seja automático a impressão de um formulário onde ja prescrito o técnico de enfermagem retiraria essa dieta da Farmácia, após assinatura do prescritor. ',null,null,to_date('03/04/19','DD/MM/RR'),null,null,'1','1','21','241',null,null,null,null,null,'462',null,null,null,null,null,'S',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,to_date('02/04/19','DD/MM/RR'),'FRN','S',null,null,null,null,null,null,'Ramal: 4107',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'4',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'STA-011682',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'96',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'N',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null);
